import React from 'react';
import s from './ImageBlock.module.css';

import imageGirl from '../ImageBlock/img/imageBlockGirl.jpg';
import imageNature from '../ImageBlock/img/imageBlockNature.jpg';
import imageFestival from '../ImageBlock/img/imageBlockFestival.jpg';

const ImageBlock = () => {
    

    return (
        <div>
            <div className={s.container}>
                <h2>Travel Features</h2>
                <button>SEE MORE</button>
                <div className={s.imageContainer}>
                    <div className={s.card}>
                        <img src={imageGirl}></img>
                        <h3>How to avoid expensive travel mistakes</h3>
                        <p>Great tips that can help you avoid eight common and expensive travel mistakes</p>
                    </div>
                    <div className={s.card}>
                        <img src={imageNature}></img>
                        <h3>Top 5 places to experience supernatural forces</h3>
                        <p>Atlantis and the Kingdom of Asgard may be lost forever, but here are five places that you can still experience legends and supernatural forces</p>
                    </div>
                    <div className={s.card}>
                        <img src={imageFestival}></img>
                        <h3>Three wonderfully bizarre Mexican festivals</h3>
                        <p>It is not all skulls and tequila shots when it comes to festivals in Mexico, not when you have donkeys, radishes and candles compete to add fun</p>
                    </div>

                </div>
            </div>
        </div>
    );
}

export default ImageBlock;
